import React, { Component } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './styles/about.less';
import '../global/global.less';
import meSvg from './img/me.svg';
import dogSvg from './img/dogmomma.svg';
import cookieSvg from './img/cookie.svg';
import lineSvg from './img/line.svg';
import engineerSvg from './img/engineer.svg';

class About extends Component {
  render() {
    return (
      <div className="about">
          <img className="about-cookie" src={cookieSvg} />
          <img className="about-me" src={meSvg} />
          <img className="about-dog" src={dogSvg} />
          <img className="about-engineer" src={engineerSvg} />
          <img className="about-line-top-right" src={lineSvg} />
          <img className="about-line-top-left" src={lineSvg} />
          <img className="about-line-bottom-left" src={lineSvg} />
          <img className="about-line-bottom-left" src={lineSvg} />
      </div>
    );
  }
}

export default About;
